B.W_=new A.bq("The basic color palette of ClockWorld comes from the selected wallpapers, each one representing the color of the sunlight at that time of the day. As a highly customizable skin, the colors shouldn\u2019t be tied to one or two specifics but work as  base for user changes. Via the settings menu, the user can select any color or each of the 5 timestamps of the day and create their own version of he skin.",null,null,null,null,null,null)
B.W3=new A.bq("The skin\u2019s design is focused on simplicity with some bits of character, like the slight gradient color in the time. It\u2019s focused on being more practical than decorative, with clear information organized in a very distinct way.\n\nMeenimal\u2019s layout is inspired by the mobile design world where the status information is grouped together. Lines divide the information and the size plays the role of hierarchy. The time and date are the most prominent while otherI secondary elements are smaller and grouped together. Finally, a nice touch of a quote that changes every few minutes adds a emotional touch to the skin and creates a pleasant working environment.",null,null,null,null,null,null)
B.W4=new A.bq('Influenced by many other successful motion graphic designs for TV channels, I took advantage of the characteristic shape inside "ERT"\'s "R" letter and used it as the primary form. Its appealing effect is caused by smooth opacity and position transitions which describe the overall character and design principles of the channel. The "Inside R" shape is playing a key part and is moving around with the basic information elements as a guide both for the eye and the ierarchy.',null,B.d1,null,null,null,null)
B.W5=new A.bq('Motions graphics presenting the channel\'s program for the "Old" movie in Alpha Greek channel.',null,B.d1,null,null,null,null)
