B.Wk=new A.bq("Genres presentation for the VH1 music channel. The process follows the previous principle where all the genres are presented on their own with a corresponding music video and at the end, all the genres graphics together presenting the channel's content identity as a whole.",null,B.d1,null,null,null,null)
B.Wl=new A.bq('The design is based on the widely used motion graphics design for "Upcoming" content on TV channels around the world. I tried to use this approach to the conventional channel program video by adding some more eye-catching visual effects and improving its importance on the screen. What is more, the smooth transitions as well as the position of the graphics catch the attention of the watcher and ensure a readable and familiar experience.',null,B.d1,null,null,null,null)
