B.Ws=new A.bq("The skin\u2019s design is based on ClockWorld. As a designer, I want to keep a specific style that characterizes my work and makes it recognizable among other creators. Thus, I chose to keep the most prominent design choices present in ClockWorld and give them  slight twist, making something different from the same successful base. Overall, Sparse\u2019s design is very straightforward with two widgets, one on top the top and another on the bottom of the screen, coming down to information hierarchy and visual balance. The time, date and weather widgets are grouped together transforming that part of he desktop to a status center that displays basic information about everyday things. On the other hand, the music player on the bottom of the screen works as a simple indicator of the current playing song, while giving an artistic style to the desktop. All in all, the skin\u2019s design is focused on keeping things as hassle-free as possible by including the basic information anyone would need during their time using their devices. ",null,null,null,null,null,null)
B.Wt=new A.bq("Ellinikon Vintage and Ellinikon Seaside typically operate independently but occasionally both are open simultaneously. The identity of Ellinikon Vintage is characterized by bold colors, strong typography, and vintage imagery. In contrast, Ellinikon Seaside emphasizes glamour and vibrant colors. Both entities share a common principle: events are communicated with a prominent, logo-like title, followed by additional information presented with lower hierarchy.",null,null,null,null,null,null)
B.Wu=new A.bq("The Settings menu is heavily inspired by he windows 10 Fluent design system which was a successful story when it came out. The design is simple and is focused on usability without compromising on design familiarity, creating a user friendly design. The view window is split into two parts, the settings categories and the settings options. Its way of usage is really simple as users are already accustomed with this type of design from their operating system.\n\nFirst, the categories are easily recognizable by the corresponding icon in front of the text for fast reading. The wallpaper color, described before, works as the main (accent) color declaring which category is selected. After navigating to one, users can access the Settings on the right side of the window. There, depending on the type, can users interact with all kinds of interface elements such as buttons, text fields and toggles, Each one of them follows common design rules as follows:\n\nAction buttons: Filled with a light black color with rounded corners. Provide some kind of action when clicked.\nText boxes: Outlined boxes with the accent color as border. Enables clicking for entering information.\nToggles: Colored with the accent color when turned on, outlined with white when turned off.\n\nEvery skin has very similar style of Settings menu. This is done in order to effectively manage adaptability and scalability for the long term. Despite that, every skin has its own special settings and thus the Settings  changes its content but with keeping the overall design parameters the same.",null,null,null,null,null,null)
B.Wv=new A.bq("Each genre is represented by a different shape and a color, making it recognisable among the others and providing a sense of change while the element alignment stays the same. Interesting text and shape animations, represent the genre's style and keep the viewer's attention.",null,B.d1,null,null,null,null)
B.Wy=new A.bq("ClockWorld\u2019s layout is based on familiarity and ease of access. It is made sure that users can find and access information without doubt and misunderstandings. Thus, the screen is split into 4 parts and in each one there is the piece of information that suits best comfortably-wise. First, on top there is the artistic part of he skin which serves as a mental boost providing a happy message to the user. Secondly, starting from the left the music information ensures that readability rules are kept in check as most countries in the world read from left to right. After that, on the right there is the clock which is placed according to the windows original clock, with the goal of embracing familiarity. Last, the shortcuts on the bottom.",null,null,null,null,null,null)
